TimeSeries<20, 3000> Am, Alr;

int main(void)
{
	NVIC_PriorityGroupConfig(NVIC_PriorityGroup_4);	// 4 bits for pre-emption priority, 0 bits for non-preemptive subpriority
	pcUART.setPriority(1,0);
	infoButton.setPriority(2,0);

/*
	// Set SysTick to fire each 10ms
	NVIC_SetPriority(SysTick_IRQn, NVIC_EncodePriority(NVIC_GetPriorityGrouping(), 3, 0));
	RCC_ClocksTypeDef RCC_Clocks;
	RCC_GetClocksFreq(&RCC_Clocks);
	SysTick_Config(RCC_Clocks.HCLK_Frequency / 100);
*/

	greenLed.init();
	redLed.init();
	blueLed.init();
	orangeLed.init();

	pcUART.init();

	infoButton.setPressedListener(handleInfoButtonInterrupt, nullptr);
	infoButton.init();



	printf("Started\r\n");



	for (int i = 0; i < randLen; i++) {
		Am.addSample(randYm[i], randXm[i]);
		Alr.addSample(randYlr[i], randXlr[i]);
	}

	StudentsDistribution m = Am.getMean();
	printf("Real mean: 2  Real variance: 0.0009\r\n");
	printf("Computed mean: %f  Computed variance: %f\r\n", m.getMean(), m.getVariance());

	printf("m <= 1.9  ... %d  (should be false)\r\n", m <= 1.9);
	printf("m <= 1.98  ... %d  (should be true)\r\n", m <= 1.98);
	printf("m >= 2.1  ... %d  (should be false)\r\n", m >= 2.1);
	printf("m >= 2.02  ... %d  (should be true)\r\n", m >= 2.02);

	
	StudentsDistribution a = Alr.getLra();
	printf("alpha - Real mean: 2\r\n");
	printf("alpha - Computed mean: %f  Computed variance: %f\r\n", a.getMean(), a.getVariance());

	StudentsDistribution b = Alr.getLrb();
	printf("beta - Real mean: 0.001\r\n");
	printf("beta - Computed mean: %f  Computed variance: %f\r\n", b.getMean(), b.getVariance());

	StudentsDistribution x5 = Alr.getLr(5000);
	printf("x=5000 - Computed mean: %f  Computed variance: %f\r\n", x5.getMean(), x5.getVariance());

	StudentsDistribution x10 = Alr.getLr(10000);
	printf("x=10000 - Computed mean: %f  Computed variance: %f\r\n", x10.getMean(), x10.getVariance());



	int iters = 1e6;
	volatile double res, dummy = 0;

	greenLed.off();
	orangeLed.on();

	redLed.off();
	blueLed.off();
	printf("Running test #1 (mean)\r\n");
	for (int i=0; i < iters; i++) {
		GPIOD->BSRRL = GPIO_Pin_12;

		StudentsDistribution m = Am.getMean();
		res = m <= 1.94;
		
		GPIOD->BSRRH = GPIO_Pin_12;
		dummy += res;
	}

	redLed.off();
	blueLed.on();
	printf("Running test #2 (lra)\r\n");
	for (int i=0; i < iters; i++) {
		GPIOD->BSRRL = GPIO_Pin_12;

		StudentsDistribution a = Alr.getLra();
		res = a <= 1.94;
		
		GPIOD->BSRRH = GPIO_Pin_12;
		dummy += res;
	}

	redLed.on();
	blueLed.off();
	printf("Running test #3 (lrb)\r\n");
	for (int i=0; i < iters; i++) {
		GPIOD->BSRRL = GPIO_Pin_12;

		StudentsDistribution b = Alr.getLrb();
		res = b <= 1.94;
		
		GPIOD->BSRRH = GPIO_Pin_12;
		dummy += res;
	}

	redLed.on();
	blueLed.on();
	printf("Running test #4 (lr)\r\n");
	for (int i=0; i < iters; i++) {
		GPIOD->BSRRL = GPIO_Pin_12;

		StudentsDistribution x = Alr.getLr(10000);
		res = x <= 1.94;
		
		GPIOD->BSRRH = GPIO_Pin_12;
		dummy += res;
	}

	redLed.off();
	blueLed.off();
	orangeLed.off();

	printf("Tests finished. (dummy: %f)\r\n", dummy);



	NVIC_SystemLPConfig(NVIC_LP_SLEEPONEXIT, ENABLE); // This ..
	while (1) {
		__WFI(); // ... and this has to be commented out when debugging.
		mainCycles++; // This is to measure how many times we wake up from WFI. In fact, we should never wake up.
	}
}


